import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";
import LogItem from "../log-item";

const GroupedLog = () => {
    const cdrsData = useSelector(state => state.cdrsData);
    const jalali = require('moment-jalaali');
    const moment = require('persian-date');
    const orgMoment = require('moment');
    const selectedLogContact = useSelector(state => state.selectedLogContact);

    const _renderLogs = (group) => {
        console.log("cdrsData", cdrsData)
        return Object
            .keys(group)
            .map((key, index) => (
                <div key={index}>
                    <p>{key.replace('Logs', '')}</p>
                    {group[key].map((item, i) => (
                        (item.direction === "inbound" ?
                            item.to : item.from) === selectedLogContact ?
                        <LogItem item={item}/> : null
                    ))}
                </div>
            ));
    }

    return (
        <React.Fragment>
            {
                _renderLogs(cdrsData)
            }

        </React.Fragment>
    );

};


export default GroupedLog;
